let paint_names = ["Home Depot"];
let swatch_history = []
let swatch_index = 0;

function randomColor() {
    return Math.floor(Math.random() * 16777216)
}

function loadswatch(color){
    let swatch = document.getElementById("paint_swatch");
    swatch.style.backgroundColor = "#" + (("000000" + color.toString(16)).substr(-6));
    let brightness = (color >> 16) + ((color >> 8) & 255) + (color & 255);
    if(brightness > 400){
        swatch.style.color = "#000";
    }
    else {
        swatch.style.color = "#FFF";
    }
    swatch.innerText = paint_names[color % paint_names.length]
}

function nextswatch(){
    let color = randomColor();
    swatch_index += 1;
    if(swatch_index >= swatch_history.length){
        swatch_history.push(color);
    }
    loadswatch(swatch_history[swatch_index-1]);
}
function lastswatch(){
    if(swatch_index > 1){
        swatch_index -= 1;
        loadswatch(swatch_history[swatch_index - 1]);
    }
}


